def countSubstrings(s: str):
    cnt = 0
    for i in range(len(s)):
        for j in range(i,len(s)):
             cnt += (1 if s[i:j] == s[j:i:-1] else 0)

    return cnt


print(countSubstrings("aba"))
print(countSubstrings("aaa"))
print(countSubstrings("ab"))
print(countSubstrings(""))


